// import CartIcon from "../Cart/CartIcon";
import classes from "./cssFiles/logincartbutton.module.css";
import { useContext } from "react";
import CartContext from "../store/cart-context";
import { useNavigate } from "react-router-dom";

function LoginCartButton(props) {
  const cartItems = useContext(CartContext);
  const navigate = useNavigate();


  function buttonClickedToShowCart() {
    navigate("/login");
  }
  return (
    <button className={classes.button} onClick={buttonClickedToShowCart}>
      {/* <span className={classes.CartIcon}>
        <CartIcon />
      </span> */}
      <span>Login/Sign Up</span>
    </button>
  );
}

export default LoginCartButton;
